css:
@-moz-document domain("tr.anidub.com") {
::-webkit-scrollbar {
    width: 10px;
}
::-webkit-scrollbar-thumb {
    background: rgb(27, 27, 27) !important;
}
::-webkit-scrollbar-track {
    background: rgb(13, 13, 13) !important;
}
::-webkit-scrollbar-track-piece {
    background: rgb(13, 13, 13)!important;
}
::-webkit-scrollbar-corner {
    background: rgb(13, 13, 13)!important;
}
* {
    color: #aaa;
    border-color: rgba(255, 255, 255, 0.1) !important;
    box-shadow: none !important;
}
html,
body {
    background: rgb(13, 13, 13) !important;
}
#header_h,
#h_flow li.h_this ul li,
#h_flow li.h_this ul div,
#header_c,
.slider_box_h .rcol,
li.sb-light-skin,
footer,
#content section,
aside.lcol .block,
aside.rcol .block,
.story.full .poster_bg,
.news_extra_buttons,
.ui-widget-content,
.related,
.torrent,
.stat_block,
.related ul,
.torrent_c,
.stat_block ul,
.pm tbody tr,
.jq-selectbox__select-text,
.jq-selectbox__select,
#searchsuggestions {
    background: rgb(17, 17, 17) !important;
}
.comment_text,
.scriptcode,
.quote,
.bb-editor,
.bb-pane,
.navi_link a,
span.nav_ext,
.story.full .poster_bg a:hover,
.torrent .li_download_m,
.login .points,
.userinfo .avatar span,
.berror,
#header_h ul.lcol > li a:hover,
.statistics .stat_inf ul,
.statistics .stat_inf,
.userstop tbody::before,
.userstop,
.f_input,
.fieldtr select,
.f_textarea,
.xfields textarea,
.xprofile textarea,
.xfields input,
.xprofile input,
.xfields select,
.xprofile select,
.mass_comments_action select,
.jq-file__name,
.search_post:hover,
.title_spoiler,
.pm_status,
.pm,
.jq-selectbox__dropdown,
#searchsuggestions > a:hover,
li.sb-light-skin .poster,
#header_h ul.lcol > li > a:hover,
#header_h ul.lcol > li.selected > a,
.rand .title,
.login .is_login form input[type="text"],
.login .is_login form input[type="password"] {
    background: rgba(183, 183, 183, 0.1)!important;
}
.speedbar,
.torrent_h,
.avatar,
.avatar div,
.comment_text::after,
.bb-btn,
ul.black,
ul.submenu,
.header_search,
#header_h ul.lcol > li,
#header_h ul.lcol,
.jq-file__browse {
    background: none !important;
}
.title_quote::before,
.title_quote::after,
.scriptcode::before,
.quote::before {
    border: none !important;
}
.comment_text::before {
    box-shadow: 0 0 0 transparent !important;
}
.ui-dialog-titlebar-close {
    background: none !important;
    text-indent: 0
}
a.ui-dialog-titlebar-close,
span.ui-icon-closethick {
    width: 35px !important;
}
#header_b,
.search_post:hover::before,
.search_post:hover .full_link {
    display: none !important;
}
#slider_box,
.jq-selectbox__dropdown {
    z-index: 1 !important;
}
.jq-file__browse,
.title_spoiler,
.jq-selectbox__select-tex {
    text-shadow: none !important;
}
.title_spoiler img {
    display: none !important;
}
.title_spoiler {
    margin: 0;
}
.n_back span,
.n_back a,
.n_next span,
.n_next a {
    background: rgba(183, 183, 183, 0.1)!important;
    text-indent: 0;
    color: #f1f1f1!important;
    ;
    border-radius: 6px;
    padding: 5px 7px 6px 7px;
    height: auto;
    width: 73px;
}
.lcol .moder_ico li:nth-child(2) a img {
    display: none !important;
}
.lcol .moder_ico li:nth-child(2) a {
    content: url(data:image/png;base64,)
}
.sb-navigation-left,
.sb-navigation-right,
.login a.exit {
    filter: invert(95%);
}
.story .story_c,
aside.lcol .block:nth-child(2n) .block_h,
aside.rcol .block:nth-child(2) .block_h,
aside.rcol .block:nth-child(4) .block_h,
.topnews li a,
.navi_c li div a,
.sublink div a,
ul.black li a,
.login .points,
#h_flow li.h_this ul li a,
.story_h > div.lcol h2 a,
.story_h > div.lcol h1 a,
.login .points a,
li.sb-light-skin .title,
.search_post .text {
    color: #aaa!important;
}
a {
    text-decoration: none !important;
}
.rand .title span sup,
.rand .title span sub,
li.sb-light-skin .poster .rait sup,
li.sb-light-skin .poster .rait sub {
    color: #F1f1f1;
}
}
